const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  bgcolor: 'background.paper',
  border: '2px solid #000',
  boxShadow: 24,
  p: 4,
};

const TriggerButton = styled(Button)({
  position: 'fixed',
  bottom: 16,
  right: 16,
});

const ModalContent = styled('div')(style);

const PokemonCard = ({ name, image, types }) => {
  const [open, setOpen] = useState(false);

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const typeHandle = () => {
    return types[1] ? `${types[0].type.name} ${types[1].type.name}` : types[0].type.name;
  };

 

  return (
    <div>
      <Card sx={{ maxWidth: 345 }}>
        <CardActionArea onClick={handleOpen}>
          <CardMedia component="img" height="240" image={image} alt={name} />
          <CardContent>
            <Box display="flex" justifyContent="space-between">
              <Typography gutterBottom variant="h6" component="div">
                {name}
              </Typography>
              <Typography gutterBottom variant="h6" component="div">
                {typeHandle()}
              </Typography>
            </Box>
          </CardContent>
          <Button onClick={handleOpen} size="small" color="primary">
            More Details
          </Button>
        </CardActionArea>
      </Card>

     
      <Modal
        aria-labelledby="transition-modal-title"
        aria-describedby="transition-modal-description"
        open={open}
        onClose={handleClose}
        closeAfterTransition
      >
        <Fade in={open}>
          <ModalContent>
            <h2 id="transition-modal-title" className="modal-title">
              Text in a modal
            </h2>
            <span id="transition-modal-description" className="modal-description">
              Duis mollis, est non commodo luctus, nisi erat porttitor ligula.
            </span>
          </ModalContent>
        </Fade>
      </Modal>

      <Stack spacing={2}>
      <Pagination count={10} />
      <Pagination count={10} color="primary" />
      <Pagination count={10} color="secondary" />
      <Pagination count={10} disabled />
    </Stack>
    </div>
  );
};

export default PokemonCard;

